data.MB_PROMPT_TEXT_v2_1_1:
sYou are operating under MetaBlooms governance. Produce a DESIGN-ONLY INTAKE EXTRACTION from THIS CHAT ONLY.

Hard rules:

No execution claims.

No persistence claims.

No normalization or reconciliation.

No omission of named items.

No invented artifacts.

If you cannot complete a required section due to limits, fail closed and say what is missing.

Output must be machine-parseable JSON only (no prose), wrapped in a single JSON object with this schema:

{
"meta": {
"chat_title_guess": string|null,
"extracted_at_utc": string,
"mode": "DESIGN_ONLY_INTAKE",
"scope": "THIS_CHAT_ONLY",
"fail_closed": boolean,
"fail_reason": string|null
},
"components": {
"engines": [ { "name": string, "quotes": [string], "category": "engine" } ],
"pipelines": [ { "name": string, "quotes": [string], "category": "pipeline" } ],
"processes": [ { "name": string, "quotes": [string], "category": "process" } ],
"segments": [ { "name": string, "quotes": [string], "category": "segment" } ],
"gates_validators": [ { "name": string, "quotes": [string], "category": "gate_or_validator" } ],
"artifacts_state_objects": [ { "name": string, "quotes": [string], "category": "artifact_or_state" } ],
"tools_apps": [ { "name": string, "quotes": [string], "category": "tool_or_app" } ],
"terms_ambiguous": [ { "term": string, "quotes": [string], "why_ambiguous": string } ]
},
"relationships": [
{ "type": "implies|requires|precedes|feeds|blocks|overrides|exports|persists",
"from": string,
"to": string,
"quotes": [string]
}
],
"invariants": [
{ "statement": string, "quotes": [string], "severity": "P0|P1|P2" }
],
"failure_modes": [
{ "name": string, "quotes": [string], "impact": "low|medium|high" }
],
"open_questions": [
{ "question": string, "why_open": string, "quotes": [string] }
],
"optional_execution_artifacts": {
"claims_present": boolean,
"claims": [
{ "claim": string, "evidence_provided_in_chat": boolean, "evidence_quotes": [string] }
]
}
}

Extraction instructions (critical):

List every named component exactly as written in the chat. No renaming.

For each component, include at least one direct quote (short excerpt) that proves it appeared.

Relationships must be derived only from explicit statements or very direct implications; include quotes.

If a category is empty, output an empty array (not null).

If output would exceed limits, set meta.fail_closed=true and include meta.fail_reason, but still output as much of the schema as possible without truncating JSON validity.

Return ONLY the JSON object. No markdown. No commentary.

PROMPT END
